import React, { Component } from "react";

export default class App extends Component {
    handleSubmit = e => {
        e.preventDefault();
    };
    render() {
        return ( <
            form onSubmit = { this.handleSubmit } >
            <
            PhoneInput {...this.state }
            onChange = { this.handleChange }
            /> <
            button type = "submit"
            disabled = { this.state.isValid } > Submit < /button> <
            /form>
        );
    }
}
